            }
            {cloudAmount>20&&
            <img src={cloud} alt="cloud" className="cloud2"></img>
            }
            {cloudAmount>30&&
            <img src={cloud} alt="cloud" className="cloud3"></img>
            }
             {cloudAmount>40&&
            <img src={cloud} alt="cloud" className="cloud4"></img>
            }

